void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;
    float speed = 10.0;
    vec3 fim = vec3(
    sin((iTime * uv.x) / sin(uv.x * 2.0) + iTime * speed) * 2.0,
    sin((iTime * uv.y) / cos(uv.x)) * 2.0,
    1.0);

    // Output to screen
    fragColor = vec4(fim, 1.0);
}
